import React from 'react'
import Container from 'react-bootstrap/Container'

class InterfacePage extends React.Component<{name: string},{test: string}> {

  constructor(props:any){
    super(props)
    this.state = {
      test: 'yes'
    }
  }

  render(){
    console.log(this.props)
    return(
      <div>
      <Container>
      <h1></h1>
      <div>
        ur name is {this.props.name}
      </div>
      </Container>
      </div>
    )
  }
}

export default InterfacePage
